import { Card } from 'semantic-ui-react';



function PlacesSummary({ placesdata }) {

    function mapProducts(placesdata) {
        return products.map(place => ({
            header: place.name,
            image: place.picture,
            color: 'teal',
            fluid: true,
            childkey: place._id,
            href: `/product?_id=${place._id}`
        }))
    }

    return <Card.Group itemsPerRow="3" stackable centered items={mapProducts(placesdata)} />;
}

export default PlacesSummary;
